t-align:right\\\"><span style=\\\"font-size:1.5em\\\">.<span style=\\\"color:#0086ff\\\">المقدّمةُ:</span><span style=\\\"color:#000000\\\"> التّعريفُ بالتّكنولوجيا وبعضِ الوسائلِ المستخدمةِ منْها داخلَ المنزلِ </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#0086ff\\\">صلبُ الموضوعِ:</span><span style=\\\"color:#000000\\\"> ويتألّفُ منْ فقرتينِ، الأولى تذكرُ فيها إيجابيّاتِ دخولِ التّكنولوجيا </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#000000\\\">.والثّانيةُ تذكرُ فيها السّلبيّاتِ</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#000000\\\">.</span><span style=\\\"color:#0086ff\\\">الخاتمةُ:</span><span style=\\\"color:#000000\\\"> يعبّرُ التّلميذُ في الخاتمةِ عنْ رأيِهِ ويقترحُ حلولًا </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6b1f9008-f716-4c61-a7e6-015ed19e572a\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.153846153846154,\"y\":83.41880341880342,\"width\":7.990867579908676,\"height\":14.202820903094874,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"الصورة\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAdIAAAHSCAYAAAEvZ3qgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAH90SURBVHhe7Z0HmCxF1feb14QoiAJGQKIKKooEs/iZXrMCkkRQQFBRVETEPN6dru7ZG7hcJIgJA4iCiAKiV0CQZEIk+Er
